package com.example.clothes;

import androidx.test.InstrumentationRegistry;

import com.example.clothes.model.Clothe;
import com.example.clothes.model.ClotheDAO;
import com.example.clothes.model.Database;
import com.example.clothes.view.ActivityList.ClotheAdapter;

import org.junit.After;
import org.junit.Before;
import org.junit.Test;

import java.util.ArrayList;
import java.util.List;

import static org.junit.Assert.*;

public class ClotheDAOTest {

    private Database db;
    private Clothe c;
    private ClotheDAO cDAO;

    @Before
    public void setUp() {
        InstrumentationRegistry.getTargetContext().deleteDatabase(Database.DATABASE_NAME);
        db = Database.getInstance(InstrumentationRegistry.getTargetContext());
        c = new Clothe(null, "Jersey", 10, "XS", "Un jersey muy viejo",
                "10/10/2010", true, "Nuevo", "");
        cDAO = new ClotheDAO(c);
    }

    @After
    public void tearDown() {
        db.close();
    }

    @Test
    public void test() {
        Long id = null;
        try {
            id = cDAO.insert();
        } catch (Exception e) {
        }
        assertNotEquals(id, null);  //CP-ClotheDAO-01

        cDAO.setId(null);
        assertEquals(null,cDAO.getClothe()); //CP-ClotheDAO-02

        cDAO.setId(new Integer(id.intValue()));
        Clothe insertedClothe = cDAO.getClothe();
        assertNotEquals(null,insertedClothe); //CP-ClotheDAO-03

        assertEquals(insertedClothe.getName(),"Jersey"); //CP-ClotheDAO-04
        assertEquals(insertedClothe.getPrice(),new Integer(10));
        assertEquals(insertedClothe.getSize(),"XS");
        assertEquals(insertedClothe.getDescription(),"Un jersey muy viejo");
        assertEquals(insertedClothe.getPurchaseDate(),"10/10/2010");
        assertEquals(insertedClothe.isFavorite(),true);
        assertEquals(insertedClothe.getState(),"Nuevo");
        assertEquals(insertedClothe.getImage(),"");


        List<Clothe> clothes = ClotheDAO.getClothes();
        assertEquals(false,clothes.isEmpty());  //CP-ClotheDAO-05

        cDAO.setId(null);
        assertEquals(cDAO.update(), false);     //CP-ClotheDAO-06

        cDAO.setId(10);
        assertEquals(cDAO.update(), false);     //CP-ClotheDAO-07

        cDAO.setId(new Integer(id.intValue()));
        assertEquals(cDAO.update(), true);      //CP-ClotheDAO-08

        cDAO.setId(null);
        assertEquals(cDAO.remove(), false);     //CP-ClotheDAO-09

        cDAO.setId(10);
        assertEquals(cDAO.remove(), false);     //CP-ClotheDAO-10

        cDAO.setId(new Integer(id.intValue()));
        assertEquals(cDAO.remove(), true);      //CP-ClotheDAO-11

    }

}